/* define our own serial function, this will be assigned later */

extern "C" uint8_t u8x8_byte_arduino_serial(u8x8_t *u8g2, uint8_t msg, uint8_t arg_int, void *arg_ptr)
{
  uint8_t *data;
 
  switch(msg)
  {
    case U8X8_MSG_BYTE_SEND:
      data = (uint8_t *)arg_ptr;
      while( arg_int > 0 )
      {      
	while(PRINTER_SERIAL.available() > 0) 
                PRINTER_SERIAL.read();      
	PRINTER_SERIAL.write((uint8_t)*data);
	data++;
	arg_int--;
      }
      break;
      
    case U8X8_MSG_BYTE_INIT:
      delay(1000);
      PRINTER_SERIAL.begin(9600, SERIAL_8N1, 4, 5);
      PRINTER_SERIAL.write(27);
      PRINTER_SERIAL.write(64);
      delay(1000);
      
      break;
      
    case U8X8_MSG_BYTE_SET_DC:
      break;
      
    case U8X8_MSG_BYTE_START_TRANSFER:  
      break;
      
    case U8X8_MSG_BYTE_END_TRANSFER:      
      break;
      
    default:
      return 0;
  }
  return 1;
}

